function KillStats({killStats}) {
    console.log(killStats)
    try {
        killStats.map(object => console.log(object));
    } catch (err) {
        console.error(err);
    }

    return (
        <div>
            {killStats.map((entry) => <div><p>{entry.type}</p><p>{entry.kills}</p></div>)}
        </div>
    )
}

export default KillStats;
